class testOMIEWebParsersLocal(unittest.TestCase):
    """
    This test case should test the function and the class sepreatedly
    """

    def setUp(self):
        # setting up handler in test.
        # print("setting up")
        # import handlers method:
        # inicialize handlers:
        self.fechatest = datetime.datetime(2013,1,1)
        self.assertIsNone(validafecha(self.fechatest))
        self.get_files()
    
    def tearDown(self):
        #print("tearing it down")
        # Delete each inicialized handler.
        pass
        
    def get_files(self):
        try:
            # check if all files exists:
            url = omiepreciosurl(self.fechatest)
            if not os.path.isfile(url[41:]):
                # if not it will try to get data from the web
                webFile = urlopen(url)
                #self.assertIsInstance(webFile,instance)
                localFile = open(url[41:], 'w')
                localFile.write(webFile.read())
                webFile.close()
                localFile.close()
            self.assertTrue(os.path.isfile(url[41:]))
            # check if all files exists:
            url = omieenergiasurl(self.fechatest)
            if not os.path.isfile(url[37:]):
                # if not it will try to get data from the web
                webFile = urlopen(url)
                #self.assertIsInstance(webFile,instance)
                localFile = open(url[37:], 'w')
                localFile.write(webFile.read())
                webFile.close()
                localFile.close()
            self.assertTrue(os.path.isfile(url[37:]))
            # check if all files exists:
            url = omietecnologiasurl(self.fechatest)
            if not os.path.isfile(url[39:]):
                # if not it will try to get data from the web
                webFile = urlopen(url)
                #self.assertIsInstance(webFile,instance)
                localFile = open(url[39:], 'w')
                localFile.write(webFile.read())
                webFile.close()
                localFile.close()
            self.assertTrue(os.path.isfile(url[39:]))
        except:
            raise
        else:
            pass

